import "./UserList.css"
import { DataGrid } from '@material-ui/data-grid';


export default function UserList(){
    const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        {
          field: 'Username',
          headerName: 'Username',
          width: 150,
          editable: true,
        },
        {
          field: 'email',
          headerName: 'Email',
          width: 150,
          editable: true,
        },
        {
            field: 'avtar',
            headerName: 'Avtar',
            width: 150,
            editable: true,
          },
        {
          field: 'CodeForces Handle',
          headerName: 'CodeForces Id',
          type: 'string',
          width: 200,
          editable: true,
        },
        {
            field: 'CodeChef Handle',
            headerName: 'CodeChef Id',
            type: 'string',
            width: 200,
            editable: true,
          },
          {
            field: 'CodeChef Rating',
            headerName: 'CodeChef Rating',
            type: 'string',
            width: 200,
            editable: true,
          },
          {
            field: 'CodeForces Rating',
            headerName: 'CodeForces Rating',
            type: 'string',
            width: 200,
            editable: true,
          },
          {
            field: 'Streak',
            headerName: 'Contest Streak',
            type: 'string',
            width: 200,
            editable: true,
          },
      ];
      
      const rows = [
        { id: 1, Username: 'Snow', email: "xyz@", avtar:"https://images.pexels.com/photos/4172933/pexels-photo-4172933.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940", Streak: 33, CfRating: 1800, CCRating: 1800},
       
      ];


    return(
        <div className="userList">
       <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        checkboxSelection
        disableSelectionOnClick
      />
        </div>
    )
}
